import Button from '../../../components/Button';
import { InputBox } from './login';


export const ContainerForm = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #FFCFCD;
  display: flex;
  align-items: center;
  flex-direction: column; 
  margin: 0;
  padding: 5rem;
`;

export const Form = styled.form`
  width: 40%;
  height: 35vh;
  background-color: #fff;
  display: flex;
  align-items: center;
  flex-direction: column;
  justify-content: space-evenly;

`;

export const Title = styled.h1`
  width: 63%;
  font-size: 1rem;
  margin-top: 0.9rem;
`;


export const BoxErro = styled.div`
	width: 62%;
	display: flex;
	flex-direction: column;

`;

export const Erro = styled.p`
  color: #FF4136;
`;

export const Span= styled.span` 
  color: #231F20;

`;

  export const SpanParagraph = styled.span`

`;

class ErroPassoword extends React.Component {

  render() {
  	// console.log(this.state.value);
  	return (
		  <div>
		  <ImageLogo/>
  			<Form onSubmit={this.handleSubmit}>
         	<Title>Here is your password reset code:</Title>
  				<BoxErro>
  					<Erro>210704</Erro>
  				</BoxErro>
  				<Span>
  					<SpanParagraph>A password reset was required for your email address:
                        name@email.com. If you did not perform this request,
                        you can access your account normally.</SpanParagraph>
  				</Span>
  			</Form>
  		</div>
  	);
  }
}

export default ErroPassoword;
